import "./Option.css";
import React, { useEffect } from "react";
function Option() {
	useEffect(() => {
		OptionDropDown();
	}, []);

	return <div className="OptionParent" id="OptionParent"></div>;
}

const OptionDropDown = () => {};

export default Option;
